import React, { Fragment } from 'react';

const Card = ({name, email, id}) => {
	return(
		<Fragment>
		<div  className='tc bg-light-green br3 pa2 ma2 grow bw2 shadow-5 w=200x200'>
		<img alt="robofriends" src={`https://robohash.org/${id}?`} />
		<h2 >{name}</h2>
		<p>{email}</p>
		</div>
		</Fragment>
		);
}

export default Card;
